import React, {Component} from 'react';

class MiniCount extends Component {
    render() {
        return (
            <div className="col-md-3">
                <div className="counter">
                    <i className={this.props.count_icon +" fa-2x"} />
                    <h2 className="timer count-title counter-value" data-count={this.props.count_values} />
                    <p className="count-text client">{this.props.title_count}</p>
                </div>
            </div>
        );
    }
}

export default MiniCount;
